import React from "react";
import NavBar from "./NavBar";
import "../../App.css";
import {BrowserRouter as Router } from 'react-router-dom';
import { GlobalStyle } from './globalStyles';
import Hero from '../Hero';
import Products from '../Products';
import { productData, productDataTwo, productDataThree } from '../Products/data';
import Feature from '../Feature';
import Footer from '../Footer';

const FoodSelection = () => {
    return (
        <Router>
            <NavBar />
            <GlobalStyle />
            <Hero />
            <div id='appetizers'>
                <Products heading='Choose your Appetizer' data={productData}/>
            </div>
            <Feature />
            <div id='entrees'>
                <Products heading='Choose your Entree' data={productDataTwo}/>
            </div>
            <div id='desserts'>
                <Products heading='Choose your Dessert' data={productDataThree}/>
            </div>
            <Footer />
            
        </Router>
    );
}

export default FoodSelection;
